sql: "-- Note: Unless you save your query, these tabs will NOT persist if you clear\
  \ your cookies or change browsers.\n\nSELECT repository_name,\n       url,\n   \
  \    branch,\n       repository.repo_creation AS created,\n       git_name AS main_contributor,\n\
  \       is_archive\nFROM repository\nLEFT JOIN contributors c on c.id = repository.main_contributor_id\n\
  WHERE repository_name LIKE 'MS.%' AND is_archive IS NOT NULL\nORDER BY branch, created\
  \ DESC"
